  [],\n\t\"revision_timestamp\": \"2015-05-07T00:52:27.483548\",\n\t\"name\": \"microfabricated-94-ghz-25-w-helical-traveling-wave-tube-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Teraphysics Corporation proposes to design
  and develop a microfabricated, 94 GHz, 25 W traveling wave tube (TWT) with 53&#37;
  efficiency for NASA applications.  In Phase I, we plan to prove feasibility by completing
  electrical designs of all major components.  In Phase II, we would complete the
  mechanical design, fabrication, assembly, and test of a laboratory model.  To successfully
  complete this program, Teraphysics will apply our expertise in vacuum electronics
  focusing in mm-wave and THz devices; expertise in high level, three-dimensional,
  computational modeling; novel, patent protected, helical TWT designs for mm-wave
  and THz operation; and novel, patent protected, helical TWT microfabrication techniques.
  In Phase I, the technology will advance from TRL 2 to 3.\",\n\t\"license_title\":
